script: |
  super -f text -I q3331.spq | sort > q3331.out

inputs:
  - name: q3331.spq
    data: |
      SELECT DISTINCT tab0.col1 AS col2 FROM tab0 (FORMAT parquet) WHERE col0 - - col1 NOT IN ( - col1 * tab0.col0 * col0 );
  - name: tab0

outputs:
  - name: q3331.out
    data: |
      86
      91
      97
